import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Fragment } from "react";
import { publicRoutes } from "./routes";
import { DefaultLayout } from "./layouts";

import Products from "./pages/Products";
import Product from "./pages/Product";
import PrivateRoute from "./PrivateRoute";
import AddProduct from "./pages/AddProduct";
import AddProductType from "./pages/AddProductType";

import ProductTypeDetail from "./pages/ProductTypeDetail";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {publicRoutes.map((route, index) => {
            const Page = route.component;
            let Layout = DefaultLayout;
            if (route.layout) {
              Layout = route.layout;
            } else if (route.layout === null) {
              Layout = Fragment;
            }
            if (!route.private) {
              return (
                <Route
                  key={index}
                  path={route.path}
                  element={
                    <Layout>
                      <Page />
                    </Layout>
                  }
                />
              );
            } 
            else if(route.private){
              return (
                <Route key={index} path={route.path} element={<Page />}>
                  {route.private.map((item, index) => {
                    const PagePrivate = item.component;

                    return (
                      <Route key={index} path={item.path} element={

                          <PagePrivate/>

                      } />
                    );
                  })}
                </Route>
              );
            }
          })}
          <Route path="/admin" element={<PrivateRoute />}>
              <Route path="/admin" element={<Product />} />
              <Route path="/admin/producttype" element={<Products />} />
              <Route path="/admin/producttype/item/:id" element={<ProductTypeDetail />} />
              <Route
                path="/admin/producttype/new"
                element={<AddProductType />}
              />
              <Route path="/admin/products/new" element={<AddProduct />} />
              <Route path="/admin/products" element={<Product />} />
            </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
